script: |
  super -f text -I q12307.spq | sort > q12307.out

inputs:
  - name: q12307.spq
    data: |
      SELECT + col1 - + col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE - 30 + - col2 + - col0 NOT BETWEEN 65 * - col2 AND ( + - col0 );
  - name: tab1

outputs:
  - name: q12307.out
    data: |
